    const [ropa, setRopa] = useState([])

    const getRopa = () => {
        return new Promise((res, rej) => {
            setTimeout(() => {
                setRopa(data.elements)
            }, 2000)
        })
    }
    getRopa()

    return (
        <Row className="justify-content-md-center">
            {ropa.map((info) => (
                <Col md="4" mb="2">
{/*                     <Link to={`/prenda/${info.id}`}> */}
                        <Item prenda={info} />
{/*                     </Link> */}
                </Col>
            ))}
        </Row>
    )

}
export default ItemList;
